    <style>
        *{
            padding: 0;
            margin: 0;
            box-sizing: border-box;
            font-family: monospace;
        }
        #svg-container{
            width: 35%;
        }
        @media(max-width:698px){
            #svg-container{
            width: 60%;
        }

        @media(max-width:496px){

            width: 75%;
        }

        @media(max-width:496px){
            #svg-container{
            width: 75%;
        }
        }
        #arrow{
            animation: up-down alternate ease-in-out 2s infinite;
            -webkit-animation: up-down alternate ease-in-out 2s infinite;
            -moz-animation: up-down alternate ease-in-out 2s infinite;
            -o-animation: up-down alternate ease-in-out 2s infinite;
        }
        
        @keyframes up-down{
            0%{
                transform: translateY(5px);
            }
            100%{
                transform: translateY(-5px);
            }
        }
        @-webkit-keyframes up-down{
            0%{
                transform: translateY(5px);
            }
            100%{
                transform: translateY(-5px);
            }
        }
        @-moz-keyframes up-down{
            0%{
                transform: translateY(5px);
            }
            100%{
                transform: translateY(-5px);
            }
        }
        @-o-keyframes up-down{
            0%{
                transform: translateY(5px);
            }
            100%{
                transform: translateY(-5px);
            }
        }

        #slider{
            animation: slider alternate ease-in-out 2s infinite 0.5s;
            -webkit-animation: slider alternate ease-in-out 2s infinite 0.5s;
            -moz-animation: slider alternate ease-in-out 2s infinite 0.5s;
            -o-animation: slider alternate ease-in-out 2s infinite 0.5s;
        }
        @keyframes slider{
            0%{
                transform: translateY(25px);
            }
            100%{
                transform: translateY(-55px);
            }
        }
        @-webkit-keyframes slider{
            0%{
                transform: translateY(25px);
            }
            100%{
                transform: translateY(-55px);
            }
        }
        @-moz-keyframes slider{
            0%{
                transform: translateY(25px);
            }
            100%{
                transform: translateY(-55px);
            }
        }
        @-o-keyframes slider{
            0%{
                transform: translateY(25px);
            }
            100%{
                transform: translateY(-55px);
            }
        }
        
        .float{
            animation: float alternate cubic-bezier(.65, 2, .03, .32) 2s infinite ;
            -webkit-animation: float alternate cubic-bezier(.65, 2, .03, .32) 2s infinite ;
            -moz-animation: float alternate cubic-bezier(.65, 2, .03, .32) 2s infinite ;
            -o-animation: float alternate cubic-bezier(.65, 2, .03, .32) 2s infinite ;
        }
        @keyframes float{
            0%{
                transform: translateY(10px);
            }
            100%{
                transform: translateY(-2px);
            }
        }
        @-webkit-keyframes float{
            0%{
                transform: translateY(10px);
            }
            100%{
                transform: translateY(-2px);
            }
        }
        @-moz-keyframes float{
            0%{
                transform: translateY(10px);
            }
            100%{
                transform: translateY(-2px);
            }
        }
        @-o-keyframes float{
            0%{
                transform: translateY(10px);
            }
            100%{
                transform: translateY(-2px);
            }
        }
    </style>
